(30, 0, '2', 'Fortunate Infinite (Make it 13)', 'Unity', 'fortunate-infinite-make-it-13', 'Fortunate Infinite is chain number puzzle, marge colourful blocks, jigsaw puzzles, drag the colourful match blocks, match the\r\nlogic number, and other block elements are combined to give you a special colour merge experience', '2020-12-14 18:09:48', '2021-02-03 18:09:55', 'ANJ Webtech', '1614602434', 2, 0, '', '', '2021-03-01 18:10:34', '0000-00-00 00:00:00', 'https://anjpms.com/Invite/anj/MzA/fortunate-infinite-make-it-13/nirav/Mg/1614602434', '0', 'Medium', 'Task Hours', '50', '1', ''),
