(33, 0, '2', 'School APP ( spine animation)', 'Android and iOS native', 'school-app-spine-animation', 'This is the game application which we have to convert in Android and iOS native. In this application we used Spine Animation and libGDX for run Character Animation in Android native sdk.\r\n\r\nThis app is cancelled by developer because character animation has to much limitation for build this app in native.\r\n', '2020-10-01 18:30:14', '2020-11-04 18:30:18', 'ANJ Webtech', '1614603631', 2, 0, '', '', '2021-03-01 18:30:31', '0000-00-00 00:00:00', 'https://anjpms.com/Invite/anj/MzM/school-app-spine-animation/nirav/Mg/1614603631', '0', 'Medium', 'Task Hours', '50', '1', ''),
(34, 0, '2', 'Sharever : File sharing app', 'Android', 'sharever-file-sharing-app', '\r\nSharEver as the name suggest share each and everything you want to share with other devices done with this app. It is the fastest file transfer application.\r\n- It supports multiple devices and multiple file-formats without the internet and mobile data.\r\n- For sharing files there are two options available in this app - Wi-Fi and Hotspot.\r\n- If two devices are on the same network use Wi-Fi QR code for receiving files or else both devices are on a different network then use the Hotspot QR scan for receiving files.\r\n- Multiple file types are also sent with one time scanning QR code.\r\n- There is no size limit as well as no data limit for sharing files.\r\n- This app is 100 times faster than Bluetooth for file transfer.\r\n\r\nStatus : Completed\r\n\r\nLive Link ::: https://play.google.com/store/apps/details?id=anj.webtech.FileSharingApp&hl=en-GB\r\n\r\napprox time :::: 12 days', '2020-12-09 18:31:22', '2021-01-31 18:31:26', 'ANJ Webtech', '1614603728', 2, 0, '', '', '2021-03-01 18:32:08', '0000-00-00 00:00:00', 'https://anjpms.com/Invite/anj/MzQ/sharever-file-sharing-app/nirav/Mg/1614603728', '0', 'Medium', 'Task Hours', '50', '1', ''),
