--
-- Table structure for table `tbl_users`
--

CREATE TABLE `tbl_users` (
  `user_id` int(11) NOT NULL,
  `designation` varchar(50) NOT NULL DEFAULT 'Master',
  `user_type` tinyint(1) NOT NULL DEFAULT 1,
  `username` varchar(100) CHARACTER SET utf8 NOT NULL,
  `slug_username` varchar(255) NOT NULL,
  `first_name` varchar(500) NOT NULL,
  `last_name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `code` varchar(10) NOT NULL,
  `mobile_no` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `last_login` datetime NOT NULL,
  `first_login` datetime NOT NULL DEFAULT current_timestamp(),
  `is_verify` tinyint(1) NOT NULL DEFAULT 0,
  `is_active` tinyint(1) NOT NULL DEFAULT 1,
  `password_reset_code` varchar(255) NOT NULL,
  `last_ip` varchar(255) NOT NULL,
  `logout_ip` varchar(50) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `token` varchar(100) NOT NULL DEFAULT '0',
  `oauth_provider` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0=web,1=facebook, 2=google',
  `picture` varchar(900) NOT NULL DEFAULT 'notDelete.png',
  `picture_url` varchar(500) NOT NULL DEFAULT 'https://anjpms.com/uploads/notDelete.png',
  `web_app` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0=web, 1=app',
  `eDelete` tinyint(1) NOT NULL DEFAULT 0,
  `online` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0=online,1=offline',
  `merge_account` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0=no, 1=yes',
  `month_year` varchar(50) NOT NULL,
  `month_count` int(11) NOT NULL,
  `plan_packages` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1=free,2=platinum,3=standard',
  `package_date` datetime NOT NULL,
  `file_sharing_storage` varchar(500) NOT NULL DEFAULT '100000',
  `max_file_size_upload` varchar(20) NOT NULL DEFAULT '5' COMMENT 'store in MB',
  `user_about` text NOT NULL,
  `total_user_support` int(11) NOT NULL DEFAULT 5,
  `payment_expire_time` varchar(50) NOT NULL,
  `paymentyesnot` tinyint(1) NOT NULL DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

